/**
 * Sidebar routes for UrbanSense AI
 */

const routes = [
  {
    path: '/app/dashboard',
    icon: 'HomeIcon',
    name: 'Dashboard',
  },

  {
    path: '/app/flood',
    icon: 'TablesIcon',
    name: 'Flood Monitoring',
  },

  {
    path: '/app/aqi',
    icon: 'ChartsIcon',
    name: 'AQI Monitoring',
  },

  {
    path: '/app/waste',
    icon: 'FormsIcon',
    name: 'Waste Management',
  },

  {
    path: '/app/weather',
    icon: 'BellIcon',
    name: 'Weather Alerts',
  },

  {
    path: '/app/reports',
    icon: 'PagesIcon',
    name: 'Reports',
  },

  {
    path: '/app/admin',
    icon: 'SettingsIcon',
    name: 'Admin Panel',
  },
]

export default routes
